import axios from "axios";

interface User {
	id: number,
	email: string,
	firstName?: string,
	lastName?: string,
	userName?: string,
}

function GetAllUsers(): User[] {

	const users: Array<User> = [];

	axios.get('http://localhost:3001/user')
	.then(response => {
		response.data.forEach((element: User) => {
			users.push(element);
		});
	});
	return users;
}

const App:React.FC = () =>
{
